    "2013-12-07T09:05:30.733905",nt"name": "cass-county-aerial-photography-2011",nt"isopen":
    false,nt"url": null,nt"notes": "The project encompassed an area of approximately
    1304 square miles. A Leica ADS40/SH52 Digital Camera system including an inertial
    measuring unit (IMU) and a dual frequency airborne GPS receiver was used for the
    digital image acquisition. Imagery acquisition was performed May 15-17, 2011 at
    4800' AMT (above mean terrain), with 30 percent sidelap between the flight lines.
    Digital orthophotos in TIFF format were produced with a resolution of 0.5 foot utilizing
    the ADS40/SH52 imagery and Red River Basin LiDAR Elevation DEM.",nt"license_title":
